●φ3.5mmステレオ出力端子接続でiPhone・iPod、スマートフォンやウォークマンなどのイヤホン出力端子接続により音源を取り入れ、FMラジオへ電波で飛ばし、車内のスピーカーから聴くことができるFMステレオトランスミッターです。<br>●お車のアンテナと本体取り付け状態がFM電波環境に適していない場合、付属のサポートアンテナでFM電波環境を変更して適した場所を探せます。<br>●FM周波数76.0～90.0MHz（141ｃh）の中から0.1MHzピッチ刻みでお好きな周波数を選んでチューニングできるので、日本全国どこでもその都度最適な電波をフルバンドで探せます。<br>●ディスプレイ部分が4段階で約90°まで可動し、操作しやすい角度に調節可能です。<br>●本体側面部分にUSBポートを搭載し、音楽再生と同時にスマートフォンなどのUSB充電対応機器への充電ができます（5V/2.4A）。<br>●エンジン再始動後も前回と同じ周波数を呼び出してご使用になれる周波数メモリー機能搭載です。<br>●視認性の高いブルーLEDディスプレイ搭載です。<br>●2段階のブースト機能搭載で豊かな低音サウンドを楽しめます。<br><br><br>品番：P233<br>メーカー：セイワSEIWA<style type="text/css">
