【特長】<br>Bluetooth対応スマートフォンやデジタルオーディオプレーヤーの音声をBluetooth接続で受信し、FM周波数を利用して車載のFMラジオへ転送可能なカーキットです。<br><br>スマートフォンとのBluetooth接続で運転中のハンズフリー通話や音楽再生ができます。<br><br>ノイズリダクション＆エコーキャンセリング機能搭載で、走行中の車内でもクリアな音質・音声でご使用できます。<br><br>HSP、HFP、A2DP、AVRCPのプロファイルに対応。また、SCMS-T方式で保護された音楽データの再生や、ワンセグの音声出力にも対応しています。<br><br>選択キーで4ch（88.1/88.3/88.5/88.7MHz）のFM周波数域の中から、良好な周波数を選んで調整することが可能です。<br><br>スリムな形状とロングコードで取付け場所を限定せず、付属のバイザークリップを使用するとサンバイザーにも簡単に取付け可能です。<br><br>メインスイッチで着信・終話や音楽の再生・停止操作が行えます。<br><br>ボリューム調節機能付き。<br><br>電源プラグにUSB接続端子を内蔵し、スマートフォン等を充電しながらご使用することが可能です。(DC12V)<br><br>【メーカー】<br>セイワ<br><br>【品番】<br>BT520<style type="text/css">
