●Bluetooth対応のスマートフォン/iPhoneの通話や音楽をワイヤレスで受信、カーステレオから聴くことができます。<br>*USBポートがない車ではご使用になれません。<br><br>●Bluetoothバージョン3.0仕様。<br>（下位/上位バージョン（4.0）の携帯電話でも使用できます。）<br><br>●ハンズフリー通話対応。<br><br>●端末を2台までマルチポイント(同時接続)可能。また4台までマルチペアリング(ペアリング設定履歴保持)可能。<br><br>●FM周波数切替は88.3、88.5、88.7、88.9MHzの4バンド。<br><br>●USBポートの向きを気にせずに使える、自在に動くUSBコネクタ搭載。<br><br>●端末を4台までマルチペアリング(ペアリング設定履歴保持)可能。<br><br>●Siri対応。<br><br>●充電専用USBポート付。<br>*充電用USBケーブルは付属していません。<br><br><br>【仕様】<br>定格電圧：DC5V(USB-A)<br>定格電流：0.05A<br>消費電力：0.3W<br>入力可能電圧：DC4.75V～5.25V<br>入力可能電流：0.5A～2.4A <br><br>メーカー：カシムラ<br>品番：KD-183<style type="text/css">
