●Bluetooth対応のスマートフォン/iPhoneの音楽・ワンセグ音声やmicroSDカードの音楽・音声をカーステレオで聴くことができます。<br><br>●周波数を選ぶだけの簡単操作。(88.1/88.3/88.5/88.7MHz)<br><br>●Bluetoothバージョン4.1仕様。（従来のバージョンとも互換性があり、従来のバージョンの携帯電話でも使用できます。）<br><br>●microSDカードの音楽ファイルを再生できるプレーヤー機能付。（最大容量64GB、最大転送速度Class10、MP3/WAVファイル対応。）<br><br>●Bluetoothでの音楽再生とmicroSDカードでの音楽再生は、切り替えて操作可能。 （切替操作：ペアリングスイッチ2回押し）<br><br>●音楽リモコン機能付、再生、一時停止、曲送り、曲戻しの操作ができます。<br><br>●車のエンジンを切ると、本製品のエンジン連動機能により、端末の再生曲が自動で一時停止。<br>エンジンをONにすると端末のBluetooth機能と自動で再接続します。（一部の機種では自動停止/自動接続できない場合があります。）<br><br>●12V、24V車兼用。<br><br><br><br>【仕様】<br>入力電圧：DC12-24V<br>出力：DC5V/2.4A（2400mA） <br><br>メーカー：カシムラ<br>品番：KD-188<style type="text/css">
